const PostData = async (e) => {
    e.preventDefault();
  console.log(e)
    const {name, email, password, cpassword, education, contactNumber, presentAddress, permanentAddress, subject, addressProof}= tu;
    
     const res = await fetch("/contact",{
       method:"POST",
       headers:{
         "Content-type":"application/json"
       },
       body: JSON.stringify({
       name,email,phone,message
       })
     });
     const data = await res.json();
     console.log(data)
     if (data.status === 422 || !data) {
       window.alert("Information not filled");
       console.log("Information not filled");
     }else{
       window.alert("successfully received");
       console.log("successfully received");
  
       navigate("/");
      }
  }

  const handleSubmit = (event) => {
    event.preventDefault();



    const formData = {
      fullName,
      email,
      password,
      cPassword,
      education,
      contactNumber,
      presentAddress,
      permanentAddress,
      
     
      subjects,
      
      addressProof,
    };

    console.log(formData);
  };


  return (
    <>
    
    <formtutor onSubmit={handleSubmit}>
    <h1>Tutor Registration</h1>      
      <labela>
        <b>Full Name</b>
        <input
          type="text"
          value={fullName}
          onChange={(event) => setFullName(event.target.value)} required
        />
        {errors.fullName && <div className="error">{errors.fullName}</div>}
      </labela>
      <labelt>
        <b>Email</b>
        <input
          type="string"
          value={email}
          onChange={(event) => setEmail(event.target.value)}required
        />
        {errors.email && <div className="error">{errors.email}</div>}
      </labelt>
      <labelt>
       <b>Password</b>
        <input
          type="password"
          value={password}
          onChange={(event) => setPassword(event.target.value)}required
        />
        {errors.password && <div className="error">{errors.password}</div>}
      </labelt>
      <labelt>
        <b>Confirm Password</b>
        <input
          type="password"
          value={cPassword}
          onChange={(event) => setcPassword(event.target.value)}required
        />
        {errors.cPassword && (
          <div className="error">{errors.confirmPassword}</div>
        )}
      </labelt>
      <labelt>
       <b>Education</b> 
        <input
          type="text"
          value={education}
          onChange={(event) => setEducation(event.target.value)}required
        />
        {errors.education && <div className="error">{errors.education}</div>}
      </labelt>
      <labelt>
       <b>Contact Number</b> 
        <input
          type="number"
          value={contactNumber}
          onChange={(event) => setContactNumber(event.target.value)}required
        />
        {errors.contactNumber && (
          <div className="error">{errors.contactNumber}</div>
        )}
      </labelt>
      <labelt>
        <b>Present Address</b>
        <textarea
          value={presentAddress}
          onChange={(event) => setPresentAddress(event.target.value)}required
        />
        {errors.presentAddress && (
          <div className="error">{errors.presentAddress}</div>
        )}
      </labelt>
      <labelt>
       <b>Permanent Address</b> 
        <textarea
          value={permanentAddress}
          onChange={(event) => setPermanentAddress(event.target.value)}required
        />
            {errors.permanentAddress && (
      <div className="error">{errors.permanentAddress}</div>
    )}
  </labelt>
  <labelt>
    <b>Subject interested to teach</b>
    <input
      type="text"
      value={subjects}
      onChange={(event) => setSubjects(event.target.value)}required
    />
    {errors.subjects && <div className="error">{errors.subjects}</div>}
  </labelt>
  
  <labelt>
    <b>Address proof</b>
    <input
      type="file"
      onChange={(event) => setAddressProof(event.target.files[0])}
    />
    {errors.addressProof && (
      <div className="error">{errors.addressProof}</div>
    )}
    Aadhar/ voter-id / DL
  </labelt>
  <button type="submit">Register</button>
</formtutor>
</>
 );
}

export default Tregister;
